lol so about 3 months ago i bought cure magazine because at AX this year some of their photographers took my picture...so i bought the mag and looked at the pictures and sadly i wasnt in it...

so last night while i was setting up for the multi-cultural fair i was pointing out my friend mai in he magazine and was like "HOLY SHIT THATS ME!" turns out that after three months i found that i actually was in it! i then showed my teacher (who a japan finatic) he then congradulated me for probably being the only female in that magazine! lol! i thought it was hysterical....i scan in pic later

